column8:
お客様に代わり心を込めてお包み致します。<br>
<br>
【ご注意点】 <br>
■商品の大きさや形状によっては、ラッピングができない場合がございます<br>
■商品とラッピングは、必ず一緒にお買い物カゴに入れてください<br>
■複数個ラッピングが必要な場合は、個数分ラッピング袋をご購入願います<br>
■一部商品のみのラッピングや、複数にお分けするラッピングの場合は、<br>
詳細を備考欄に記載願います<br>
■複数個商品をご購入で、備考欄に記載がない場合は、まとめて１つにラッピングいたします<br>
■メール便の場合は、ラッピングせずにギフト袋を同封いたします<br>
ご注文者様の住所と違うお届け先の場合は、メール便でのラッピングはお受けできません<br>
■通常宅配便の場合は商品をラッピングでお包みしての発送になります<br />
■ご不明な点があれば、当店にお気軽にご連絡願います<br>
<hr>
M : 幅370&times;高さ560mm<br>
L : 幅500&times;高さ755mm<br>
LL : 幅650&times;高さ950mm<br>
※全サイズ マチなし<br>
<br>
リボンサイズ : 幅70&times;高さ60mm<br>
<br>
袋は柔らかめのビニール素材。<br>
光が当たると、光沢感がでて華やかな印象ですよ。<br>
ゴールド×ホワイトカラーは、子供から大人までシーンを問わずお使い頂けます。
<br>
